import * as React from 'react';
import { View, Text, StyleSheet} from 'react-native';
import { Button } from 'react-native-web';

export default function MealPlannerScreen({ navigation }) {
    return (
      <View style={{ position:'absolute', width: '81', height: '24', left: '147', top: '44', 
        fontFamily: 'Poppins',
        fontStyle: 'normal',
        fontWeight: 'bold',
        fontSize: '16',
        lineHeight: '24' }}>
        <Text>Meal Nutritions</Text> 
        <Button
          title="Go to Breakfast"
          onPress={() => navigation.navigate('Breakfast')}
        />  
      </View>
    );
}
